(75, 10, 205, 24, 175, 'Port Moresby', 'Tokarara', '675', '0497707823', 53, 'Verbatim USB Drive 8GB, (Store n Go)  Black Slider USB 2.0 Flash Drive', 'Product Description:\r\n\r\nThis flash drive is perfect for storing your vital files and carrying them with you on the go. It has a adroit sliding design which will allows you to retract the connector when its not in use thus keeping it protected against potential damages.\r\nIf you worry about losing your important files then look no further. This flash drive can back up your files onto the drive and all it takes is just a drag and drop with your finger tips and you are done\r\n\r\n Specifications:\r\n\r\nUSB 2.0 connectivity for fast data transfers.\r\n8 GB capacity to store your important documents, photos, music and more.\r\nSlider mechanism ensures your USB connector is protected against damage when not in use.\r\nYou can connect the drive to your lanyard or keychain to easily carry it when you\'re on the go.\r\n\r\n\r\n\r\n Condition:\r\n\r\n100% brand NEW- it has never been used or opened\r\nNo scratches or marks visible- concealed in new box ready for postage \r\nDurability:\r\n\r\nDesigned to last longer compared to the ordinary ones out there', '', 10.90, '', '', 0, 0, '', '', '', 'Yamaha', '', 0, '', 'USB Driver 8 GB', 'Offering', 'Private', '', 'New', '', '', '', '', 0.00, '', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, 'Amber', '', 335, 2, '2019-04-27', '23:12:40', 1, 335, '', NULL, NULL, NULL),
(76, 21, 136, 24, 175, 'Port Moresby', 'Tokarara', '675', '0497707823', 53, 'Detox Tea Bags 14 Day and Night Healthy Herbal Weight Loss Tea Bags Teatox Supplement (28 Teabags)', 'About the product\r\n**WEIGHT LOSS & BODY CLEANSING DETOX TEA**  Our scientifically designed blend of natural herbs boosts metabolic rate and aids the two primary filtering organs  the kidney and liver, ridding your body of toxins and promoting weight loss to make you look and feel amazing.\r\n**2 x 14 DAY TEABAGS (28 Teabags)**  Included is x2 packs of 14 weight loss teabags, the set is designed for one Morning Weight Loss Teabag  to give you a fresh boost to energize you for the day, and one Evening Weight Loss Teabag to calm your mind for a refreshing and relaxing nights sleep.WEIGHT **LOSS TAPE MEASURE**  Included totally FREE is a weight loss tape measure, so you can easily track how much weight youre losing and really see the results this flat belly teatox set has to offer!\r\n**CURB YOUR APPETITE**  However strong our willpower, after a stressful day, the desire for unhealthy and sugary foods goes through the roof. Eliminate all of your cravings with GopikoTea 14 Day Teatox and further smash your weight loss, get a solid grip onto your weight loss goals\r\n**100% NATURAL AND ORGANIC**  All of our ingredients: Green Tea, Oolong Wuiy, Pomeranate, Papaya, Peppermint, Dandelion Leaf, Stevia and Ginger are all completely Natural and Organic with NO added colours or flavorings for a totally healthy and natural blend that will bring the Glow back to your face and skin\r\n**LIFETIME REFUND**  If for any reason you are not satisfied with your GopikoTea Tea Detox Kit you can return it for a full refund. We are committed to keeping you stay Healthy, Fit and Robust and are fully confident in the results our tea brings.  you can choose to swap one out for this one if you wanted ', '', 14.99, '', '', 0, 0, '', '', '', 'Yamaha', '', 0, '', '', 'Offering', 'Private', '', 'New', '', '', '', '', 0.00, '', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, 'Amber', '', 645, 2, '2019-04-27', '23:24:43', 1, 645, '', NULL, NULL, NULL),
