(119, 2, 251, 24, 175, 'Port Moresby', 'Tokarara', '', '71978665', 35, 'Sales & Marketing Consultant', '**1 x Sales & Marketing Consultant**\r\nLocation: Port Moresby\r\nStatus/Hours: 3- 6 month Term Contract, ability to work 1-5 days per week\r\nSalary: K400 per forthright\r\n\r\nABOUT THE COMPANY....\r\nGopiko is an online classifieds network, a marketplace platform for buying and selling services and goods such as electronics, fashion items, furniture, household goods, Properties, cars, clothes, machinery etc just to name a few. \r\n\r\nABOUT THE ROLE...........\r\nThis is a 3-6 month contract position and in this role you will be one of the key points of contact for our online classified website (www.hiwantok.com) in Port Moresby.  A high level of customer service is required together with an understanding of customer needs and the ability to communicate effectively. You will need to be familiar with computers, smart phones and must be able to speak and write in good English.\r\n\r\nRESPONSIBILITIES INCLUDE:\r\n	Find potential customers (businesses/individuals) to sell/list their items on hiwantok.com\r\n	Teach people on how to Buy & Sell their items on the website\r\n	Promote the listings and the website on social media platforms\r\n\r\nAND WHAT YOU WILL NEED....\r\n	Ability to work with minimal supervision and provide feedback on timely fashion \r\n	Ability to meet deadlines and KPIs\r\n	Must possess good public relations skills \r\n	Proven troubleshooting skills\r\n	Ability to document every step performed\r\n	Strong communication and customer facing skills\r\n	Professionalism in attitude, actions and appearance\r\n	Initiative and ability to plan and organise yourself\r\n	An ability to work to deadlines and under pressure\r\n	Able to work after hours if required\r\n\r\nTERMS\r\n	Must have your own laptop or a smart phone to start with\r\n	Must be based in Port Moresby\r\n	Contract for 3-6 months, possible extension based on performance\r\n\r\nHOW TO APPLY...\r\nThis role will offer you the chance to further develop your career in a company that values its employees and has a fun culture. We believe in developing our staff and provide appropriate training and career opportunities. If this sounds like a role you would be interested in, please apply now!\r\nSend you CVs to enways17@gmail.com', '', 0.00, '', '', 0, 0, '', '', '', '', '', 0, 'Contract', '', 'Offering', '', '', '', 'Private', '', 'HIWANTOK', 'Sales & Marketing Consultant', 400.00, '01-03 Years', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, 'Amber', '', 646, 2, '2019-07-05', '02:18:41', 1, 634, '', NULL, NULL, NULL),
