(365, 2, 255, 24, 269, '', 'Port Moresby', '675', '323 0966', 142, 'Strategic Behavior Communications Officer', 'Strategic Behavior Communications Officer\r\n\r\nJob ID:\r\n\r\n70901\r\n\r\nLocation:\r\n\r\nPort Moresby, NCD, Papua New Guinea\r\n\r\nCategory:\r\n\r\nCommunity Services & Development Jobs, Health / Medical Jobs, NGO / Volunteer Jobs, Others\r\n\r\nJob Views:\r\n\r\n64\r\n\r\nPosted:\r\n\r\n09.12.2019\r\n\r\nJob Description:\r\n\r\nFHI 360 is a global development organization with a rigorous, evidence-based approach. Our professional staff includes experts in health, nutrition, education, economic development, civil society, environment and research. FHI 360 operates from 60 offices with 4,400 staff in the U.S. and around the world. Our commitment to partnerships at every level and our multidisciplinary approach enable us to have a lasting impact on the individuals, communities and countries we serveimproving lives for millions. We seek qualified candidates for the position of Strategic Behavior Communications Officer.\r\n\r\nPosition Description:\r\n\r\nThe Strategic Behavior Communication Officer will be responsible for the coordination and the development and implementation of appropriate SBCC strategy and materials. Provides programmatic support for the implementation of SBC strategy. In the role the SBC officer will also be responsible to provide technical support to the government partners and civil society organizations in NCD on the design and implementation of SBCC and other prevention activities. Successful candidate will also be responsible to develop design and conduct training or adapt activities for specific technical and particular in relation to HIV and STI services. This role will also be responsible to work with communities and partners to maximize local capacity.\r\n\r\nJob Requirements:\r\n\r\nMinimum Requirements\r\n\r\nBachelors Degree in communications/Social Work/Public Relations with experience in health promotion.\r\n\r\nMinimum 3 years working experience with demonstrated ability to manage SBC activities at large complex, health related projects, public health, marketing and social science.\r\n\r\nFamiliarity with the PNG national guidelines, protocols related to prevention and SBCC\r\n\r\nExperience in working with key population HIV programs\r\n\r\nDisplays sensitivity to cultural diversity and understanding of the political contextual and ethical issues in health and gender.\r\n\r\nPrior experience in working in a non -governmental organization (NGO) or government agencies in the health sector is an advantage\r\n\r\nApplications can be forwarded to the Human Resource team, FHI360 Country Office Port Moresby Email : recruitmentpng@fhi360.org\r\n\r\nNote only electronic applications will be entertained. For more information on the positions advertised please contact 323 0966.\r\n\r\nAn attractive salary package is provided for the successful applicant commensurate with experience and qualifications\r\n\r\nFHI360 PNG is an equal opportunity employer, Women, People Living with HIV and/or with different sexual orientation and people with disabilities are encouraged to apply.\r\n\r\nApplications close on the 24th December 2019. Note only short- listed candidates will be notified for an interview.', '', 0.00, '', '', 0, 0, '', '', '', '', '', 0, 'FullTime', '', 'Offering', '', '', '', 'Private', '', 'FHI360', 'Strategic Behavior Communications Officer', 0.00, '03-05 Years', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, 'Amber', '', 57, 1, '2020-01-04', '03:53:27', 1, 57, '', '', NULL, NULL),
(366, 2, 250, 23, 166, '', 'LAE', '675', '0', 142, 'SUPPLY PLANNER', 'SUPPLY PLANNER\r\n\r\nLocation: Morobe, Papua New Guinea\r\nIndustry: FMCG, Logistics, Transport and Supply, Manufacturing, Retail / Distribution / Supply\r\nJob ID: #8809\r\nSource: www.pngworkforce.com\r\nGoodman Fielder Papua New Guinea is one of PNGs largest food companies, manufacturing and distributing high quality Flour, Stock Feed, Rice, Snacks and Bakery products throughout the country.\r\nWell known products and brands include Flame Flour, Flame Stock feed, Bilas Bread, Skel Rice, Twisties snacks, Arthurs Pies and the Meadow Lea range.\r\nAT GFI our goal is to be the leading and most innovative food company with a mission to meet our customers needs of superior quality foods with brands that are trusted by families everywhere. We are the go-to source of consumer, shopper and customer insights to help our customer and business partners succeed.\r\nWe currently have a vacancy for a Supply Planner to join our already strong and vibrant Supply Chain team in Lae. Reporting to the Supply & Demand Planning Manager, this role will lead, plan and coordinate the supply of all products produced locally within PNG  POM and Lae\r\nYour responsibilities will include:\r\n\r\n    Weekly MRP & DRP execution with manufacturing sites, Port Moresby and Lae.\r\n    Production Planning Flour/Feed/Snacks  Port Moresby and Lae\r\n    Monitoring achievement to plan of production and Distribution, to ensure product is delivered on time.\r\n    Manage Inventory to appropriate levels to reduce working capital & storage costs while maintaining acceptable coverage to meet customer service expectations.\r\n    Report and manage the age profile of inventory held and put plans into place to address any aged stock risk. (Freshness Reporting)\r\n    Coordinate timings with Marketing, Manufacturing and Sales for packaging updates: run out / run in.\r\n    Participate in the cross category NPD Process.\r\n    Participate in S&OP Process.\r\n    Identify and drive improvement where supply inefficiencies exist.\r\n    Ensure clear and timely communication to the Customer Service Team with respect to changes in the supply plan that would impact customer orders and expectations.\r\n    Conducts weekly/monthly Supply review meetings as required to deliver an effective supply plan.\r\n    Ensure any Capacity Constraints around Machinery are highlighted via the S&OP Process.\r\n    Seeks clarity and is responsive to requests for information.\r\n    Manage Lot sizes and Production plans to reduce Aged Stock and limit Raw/Packaging Materials obsolescence.\r\n    Ensure a high Level of Supply to our customers by ensuring capacity, materials and plans are communicated executed effectively\r\n\r\nTo be considered for the role, you will need to have/be:\r\n\r\n    Logistics and Supply chain qualification\r\n    Experience with an ERP/ MRP system and strong Excel skills (intermediate) are required; Syspro experience considered favorably\r\n    Detail-oriented\r\n    Delivery and outcome-based\r\n    Organized: project management mindset/Process execution focused\r\n    Extensive knowledge of inventory management\r\n    Ability to research, compile, analyze and interpret data\r\n    Strong organizational and communicational skills\r\n    Ability to work independently under minimal supervision\r\n    Syspro ERP system\r\n    Data validation and manipulation\r\n    Supply planning experience in a FMCG 5+years\r\n\r\nBe part of the Skel life and join a team that values healthy eating and active lifestyles and wants to share that with all the people of PNG. Still interested? Send your letter of application and CV/resume with at least 2 referees to:\r\nInternal Recruiter,\r\nGoodman Fielder Papua New Guinea\r\nP.O. Box 673, Port Moresby NCD PNG\r\nE-mail: resumes@gfpng.com\r\nPlease submit your application in either word or pdf and with only one attachment.\r\nApplications close Monday 13th January 2020\r\nOnly shortlisted candidates will be contacted', '', 0.00, '', '', 0, 0, '', '', '', '', '', 0, 'FullTime', '', 'Offering', '', '', '', 'Private', '', 'GOODMAN FIELDER', 'SUPPLY PLANNER', 0.00, '03-05 Years', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, 'Amber', '', 31, 1, '2020-01-04', '04:03:20', 1, 31, '', '', NULL, NULL),
