(404, 2, 7, 24, 281, '', 'Port Moresby', '675', '0', 142, 'GENERAL MANAGER - OPH LIMITED', 'GENERAL MANAGER - OPH LIMITED\r\n\r\nJob ID:\r\n\r\n71684\r\n\r\nLocation:\r\n\r\nPort Moresby, NCD, Papua New Guinea\r\n\r\nCategory:\r\n\r\nBanking & Financial services Jobs, Management / Executive Jobs\r\n\r\nJob Views:\r\n\r\n21\r\n\r\nPosted:\r\n\r\n10.01.2020\r\n\r\nJob Description:\r\n\r\nOPH Limited is a company that owns and operates Nambawan Plaza in downtown Port Moresby. Nambawan Plaza is located on the site of the old Parliament Haus, and includes a commercial office tower (Deloitte Haus), a 54 room Serviced Apartments (Crown Plaza Residences), a prestigious 14 suite Penthouse and associated retail space. We are now seeking to recruit a highly suitable candidate for the senior position of;\r\n\r\nGENERAL MANAGER - OPH LIMITED\r\n\r\nPrimary Objective of the Position:\r\n\r\nThe General Manager will report directly to the Board of Directors, and manage all aspects of the company. Responsibilities will include; leasing negotiations with tenants either direct or through agents, management of service providers, including Intercontinental Hotels Group and Jones Lang Lasalle, ensuring all stakeholders are informed of matters concerning the precinct and supporting the Board through Board meetings and executing decisions.\r\n\r\nKey Responsibilities:\r\n\r\nEnsures vacancies are kept to a minimum, and revenues maximized for long term interests of the company.\r\n\r\nOversees service providers by measuring performance to Service Level Agreements.\r\n\r\nEnsures financial position is sound and performance to budget is reported to Board of Directors.\r\n\r\nRegularly informs all stakeholders of performance of the company, including shareholders and Board Directors.\r\n\r\nEnsures all company reporting is in compliance with obligations and appropriate regulations.\r\n\r\nMaintains stakeholder management and good business relationship between the company, shareholders, service providers and clients.\r\n\r\nHelps develop the overall strategy for the company.\r\n\r\nImplement, monitor and report on the vision and strategy.\r\n\r\nJob Requirements:\r\n\r\nQualifications and Experience:\r\n\r\nMinimum of degree in Economics, Business Administration or Management disciplines, preferably with a postgraduate degree in a relevant discipline\r\n\r\nMinimum 10 years successful experience in an Executive Management level position and or in past similar role.\r\n\r\nSelf-reliant, highly motivated and a resilient individual with the capacity to work autonomously and to assume responsibility for designated work tasks.\r\n\r\nIs driven to achieve goals and targets, and to perform in a systematic and proactive manner, displaying considerable initiative.\r\n\r\nHas to possess first class negotiation skills and a capacity to multi task and plan ahead, have good organisation skills, firm analytical skills, and be adaptable to changing and challenging working conditions.\r\n\r\nOPH Limited is an equal opportunity employer and offers an attractive salary package commensurate with qualification and experience.\r\n\r\nIf you wish to apply for this position, forward your application letter with an updated resume to:\r\n\r\nThe General Manager - People & Culture\r\n\r\nNambawan Super Ltd\r\n\r\nPO Box 483\r\n\r\nPort Moresby. NCD\r\n\r\nEmail: recruitment@nambawansuper.com.pg\r\n\r\nWebsite: www.nambawansuper.com.pg\r\n\r\nPlease include name and contact details of at least three reliable referees. Only shortlisted applicants will be contacted\r\n\r\nApplications Close: Friday 26th January, 2020.', '', 0.00, '', '', 0, 0, '', '', '', '', '', 0, 'FullTime', '', 'Offering', '', '', '', 'Private', '', 'OPH Limited', 'GENERAL MANAGER', 0.00, '15-20 Years', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, 'Amber', '', 166, 1, '2020-01-10', '08:26:26', 1, 163, '', '', NULL, NULL),
