(415, 2, 258, 23, 166, '', '411 LAE', '675', '+675 475 8601 / +675 475 8602', 142, 'APPRENTICESHIP TRAINING INTAKE 2020', 'APPRENTICESHIP TRAINING INTAKE 2020\r\n\r\nLocation: Morobe, Papua New Guinea\r\nIndustry: Apprenticeship / Cadetship / Traineeships\r\nJob ID: #8849\r\nSource: www.pngworkforce.com\r\nHornibrook NGI Limited is a major Steel Fabrication and Construction company that is involved in the Structural Steel Fabrication, Bridging, Motor Transport Engineering and Building & Construction works. The company is recognised as a Good Corporate Citizen and is involved with training and recruitment of PNG Workforce. It is an equal opportunity employer based in Lae, Morobe Province of Papua New Guinea and now offering Apprenticeship Training this year for various trades within respective divisions of the company.\r\nAPPRENTICESHIP TRAINING INTAKE 2020\r\nListed below are the Trades that will be considered for this years intake:\r\n\r\n    Carpentry\r\n    Cabinet Making\r\n    Plumbing\r\n    Painter\r\n    Metal Fabrication Welding\r\n    Heavy Equipment Fitter\r\n    Refrigeration Mechanic\r\n    Block Layer\r\n\r\nMain Requirements are:\r\n\r\n    Minimum of Grade 10 Certificate\r\n    Possess PETT Certificate from a Recognised Institution\r\n    National Certificate 1 or 2 in any of the Trades listed above\r\n    Parents Consent letter\r\n    Provide a Valid Police Clearance\r\n    Provide a Pre-Employment Medical Report\r\n\r\nInterested applicants who meet the above requirements are to forward their applications together with current updated CV, references, certificates and other relevant documents to;\r\nThe HR Manager\r\nHornibrook NGI Ltd\r\nP.O. Box 1812, Lae.MP\r\nEmail: recruitment@hornibrook.com.pg\r\nApplications close: Friday, 31st January, 2020.\r\n\r\nHornibrook NGI Ltd\r\nWe have a history of being an integral part of PNGs industrial and development. Our success can be measured in customer satisfaction, and the cost effectiveness of our products and services. It is due ...\r\nPhone:+675 475 8601 / +675 475 8602\r\nAddress:P O Box 1812, Lae, Morobe Province\r\nFax:+675 4758610\r\nWebsite:www.hornibrook.com.pg', '', 0.00, '', '', 0, 0, '', '', '', '', '', 0, 'FullTime', '', 'Offering', '', '', '', 'Private', '', 'HONIBROOK', 'APPRENTICESHIP TRAINING INTAKE 2020', 0.00, 'Graduate/Fresher', '0000-00-00', 0, 0, '', '', 0, '0000-00-00', NULL, 'Amber', '', 126, 1, '2020-01-12', '23:43:45', 1, 125, '', '', NULL, NULL),
