(3, 'FAQs', 'FAQs', 0, 0, 0, 'FAQs', '<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">What is hiwantok.com?</span><br />\r\n	Welcome to www.hiwantok.com - PNG\'s 100 % FREE Classified Site. Hiwantok.com is an online classifieds network, a marketplace platform for buying and selling services and goods such as electronics, fashion items, furniture, household goods, Properties, cars, clothes, machinery etc just to name a few. If you are looking for stuff like this then you have come to the right place . Hiwantok.com is the place to be. It is the easiest way to reach, buy, sell or trade and to interact with people with common interests across the local communities in Papua New Guinea . We warm welcome you to be part of this online community.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How much does it cost to post an Ad?</span><br />\r\n	Posting an Ad is absolutely free. However, Only PREMIuM Ads take priority positioning on search results</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How many Ads can i post on hiwantok.com?</span><br />\r\n	You can post unlimited ads. There is no limit.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How long will the ads be online for?</span><br />\r\n	Free ads will be online as long as long as it takes. However, Premium Ads will expire between 30-90 days depending on the package you choose</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How do i post an Ad?</span><br />\r\n	To post an Ad, please clcik on \" POST FREE AD\" green tab and register first then follow the prompts to create your first Ad</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How do i include photos in an Ad?</span><br />\r\n	You will find \"Upload Photos\" tab when creating your ad. Click on that tab and it will allow you to upload images from your computer. You will be only allowed to upload 5 photos for each ad</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How can i delete my Ad?</span><br />\r\n	Log into your account, select \"MY Ads\" tab in your account area and delete the ad that you wish</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How do i update and delete my account information?</span><br />\r\n	Log into your account and clcik on \"SETTINGS\" tab and update your information</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">What are the Ad posting rules on hiwantok.com?</span><br />\r\n	As a condition of your use of hiwantok.com you agree that you :<br />\r\n	 shall not be fraudulent, misrepresent, mislead or pertain to the sale of any illegal, counterfeit, stolen goods and / or services<br />\r\n	 shall not pertain to good , services of which you are not the lawful owner or you do not have the authority or consent to \'list\' which do not belong to you or you do not have the authority for  shall not infringe any intellectual property, trade secret, or other proprietary right or rights of publicity or privacy of any third party;<br />\r\n	 shall not consist of material that is an expression of bigotry, racism or hatred based on age, gender, race, religion, caste, class, lifestyle preference, and nationality and / or is in the nature of being derogatory, slanderous to any third party;<br />\r\n	 shall not be obscene, contain pornography or contain indecent representation of mankind<br />\r\n	 shall not distribute or contain spam, multiple / chain letters, or pyramid schemes in any of its forms;<br />\r\n	 shall not distribute viruses or any other technologies that may harm hiwantok.com or the interests or property of hiwantok.com users or impose an unreasonable load on the infrastructure or interfere with the proper working of Hiwantok.com<br />\r\n	 shall not, directly or indirectly, offer, attempt to offer, trade or attempt to trade in any goods and services, the dealing of which is prohibited or restricted in any manner under the provisions of any applicable law, rule, regulation or guideline for the time being in force.<br />\r\n	 shall not be placed in a wrong category or in an incorrect area of the site;<br />\r\n	 shall not be placed in any other hiwantok.com site except on the site that relates to the city in which you are located;<br />\r\n	 shall not list or post or pertain to information that is either prohibited or restricted under the laws of Papua New Guinea </p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\">How do i reply to an Ad?</span><br />\r\n	Browse to the ads displayed on the search pages and simply click on the REPLYbutton and enter your name, email, phone number and leave a message in the message form and click on thesubmit button. A confirmation message will be displayed confirming your recent activity.</p>', 'faqs'),
(4, 'About Us', 'magrack,best reseller in magine', 0, 0, 0, 'About Us', 'Welcome to www.hiwantok.com - PNG\'s 100 % FREE Classified Site.\r\n\r\nHiwantok.com is an online classifieds network, a marketplace platform for buying and selling services and goods such as electronics, fashion items, furniture, household goods, Properties, cars, clothes, machinery etc just to name a few. \r\nIf you are looking for stuff like this then you have come to the right place . Hiwantok.com is the place to be. It is the easiest way to reach, buy, sell or trade and to interact with people with common interests across the local communities in Papua New Guinea . We warm welcome you to be part of this online community.', 'about-us'),
(6, 'Privacy Policy', 'Privacy Policy', 0, 0, 0, 'Privacy Policy', '<div>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Australian Privacy Act Compliance</strong></span><br />\r\n		Because we value your privacy, we have taken the necessary precautions to be in compliance with the Privacy Act 1988 (Cth). The Privacy Act 1988 (Cth) incorporates the National Privacy Principles which set out the way in which personal information must be treated. We will treat all personal information held by us in accordance with those Principles.</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Who does the Goiko.in Privacy Policy apply to?</strong></span><br />\r\n		This Policy applies to any persons in respect of whom we currently hold personal information or whom we may in the future collect personal information from.<br />\r\n		<br />\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>What information do we collect?</strong></span><br />\r\n		We collect information from you when you register on our site, place an order or fill out a form. When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address, mailing address or phone number. You may, however, visit our site anonymously. In order to place an advertisement on the hiwantok.com website, we will require you to supply payment details, your postcode, your equipment details, a land-line or mobile number and e-mail address. Credit Card information is entered over a secure connection and is not recorded in any way by hiwantok.com<br />\r\n		.<br />\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>What do we use your information for?</strong></span><br />\r\n		We use users\' personal information to:<br />\r\n		 provide our services;<br />\r\n		 resolve disputes, collect fees, and troubleshoot problems;<br />\r\n		 encourage safe trading and enforce our policies;<br />\r\n		 customize users\' experience, measure interest in our services, and inform users about services and updates;<br />\r\n		 communicate marketing and promotional offers to you;<br />\r\n		 Do other things for users as described when we collect the information.</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Do we use cookies?</strong></span><br />\r\n		Yes - Cookies are small files that a site or its service provider transfers to your computers hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information. We use cookies to help us remember and process the items in compiling aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future.<br />\r\n		We do not use cookies to collect personally identifiable information about a person. If you prefer, you can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies via your browser settings. Like most websites, if you turn your cookies off, some of our services may not function properly. However, you can still place orders over the telephone.</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Disclosure Of Information</strong></span>.<br />\r\n		 All information contained by hiwantok.com is treated as strictly confidential and hiwantok.com does not and will not disclose or share such confidential information to / with any external organization.<br />\r\n		 The users privacy is very important to us. We do not and shall not at any point in time, either sell or rent users personal information to third parties without users explicit consent.<br />\r\n		 We may be required from time to time to disclose users personal information to Governmental or law enforcing agencies or our regulators, but we will only do so under proper authority.<br />\r\n		 hiwantok.com also reserves the right to make use of the personal information in any investigation or judicial process relating to fraud on account of such transactions during the period hiwantok.com retains such information.<br />\r\n		 We may also disclose personal information to enforce our policies, respond to claims that a posting or other content violates others rights, or protects anyones rights, property or safety.<br />\r\n		 We may also share personal information with:<br />\r\n		- Corporate affiliates who help detect or prevent potentially illegal acts and provide joint services (Our corporate affiliates will market only to users who ask them to).</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Third party links</strong></span><br />\r\n		Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites. In addition, you agree that we may send you promotions and offers from a third party which we feel may be of interest to you.</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Your Consent</strong></span><br />\r\n		By using our site, you are deemed to consent to our online privacy policy.</p>\r\n	<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n		<span style=\"color: rgb(0, 0, 255);\"><strong>Changes to our Privacy Policy</strong></span><br />\r\n		If we decide to change our privacy policy, we will post those changes on this page.</p>\r\n</div>\r\n<p>\r\n	</p>', 'privacy-policy'),
