religion, caste, class, lifestyle preference, and nationality and / or is in the nature of being derogatory, slanderous to any third party;<br />\r\n	 shall not be obscene, contain pornography or contain indecent representation of mankind<br />\r\n	 shall not distribute or contain spam, multiple / chain letters, or pyramid schemes in any of its forms;<br />\r\n	 shall not distribute viruses or any other technologies that may harm hiwantok.com or the interests or property of hiwantok.com users or impose an unreasonable load on the infrastructure or interfere with the proper working of Gopiko<br />\r\n	 shall not, directly or indirectly, offer, attempt to offer, trade or attempt to trade in any goods and services, the dealing of which is prohibited or restricted in any manner under the provisions of any applicable law, rule, regulation or guideline for the time being in force.<br />\r\n	 shall not be placed in a wrong category or in an incorrect area of the site;<br />\r\n	 shall not be placed in any other hiwantok.com site except on the site that relates to the city in which you are located;<br />\r\n	 shall not list or post or pertain to information that is either prohibited or restricted under the laws of the Australia</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>5. Advertising/Posting an Advert</strong></span><br />\r\n	By inputting or sending your advertisement to hiwantok.com, you request that the advertisement be published on our services. A valid contract is made between hiwantok.comand the user once we have verified and accepted your advertisement copy. It is the sellers responsibility to specify where each advertisement is to be published at hiwantok.com, and/or in the sellers own intranet/extranet service. hiwantok.com reserves the right to reject or withdraw an advertisement at its discretion if it considers that an advertisement does not comply with the Advertising Rules, available by following the link at the bottom of the page or for any other reason.<br />\r\n	hiwantok.com will contact you by e-mail if your advertisement for some reason is not fit for publication. hiwantok.com may deny access to the web site for users that do not act professionally or in accordance with good practice. The preconditions for publishing are evaluated individually for each advertisement.<br />\r\n	It is your responsibility as the seller to give true and complete product information on your listing whether it be FREE or PAID and clearly indicating and their condition as well as all other details that might be relevant for a potential buyer in accordance with applicable law, administrative statutes and good business practice. You agree to be bound by the guarantee, price and other information you have given on the advertisement.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<br />\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>6 Dealings with organizations or individuals</strong></span><br />\r\n	hiwantok.com shall not be liable for your interactions with any organizations and/or individuals found on the Site or through the Service. This includes, but is not limited to, payment and delivery of goods and services, and any other terms, conditions, warranties or representations associated with such dealings. These dealings are solely between you and such organizations and/or individuals. You agree that hiwantok.com is not responsible for any damage or loss incurred as a result of any such dealings. Gopiko is under no obligation to become involved in disputes between participants on the Site, or between participants on the Site and any third party. In the event of a dispute, you release Gopiko, its officers, employees, agents and successors in rights from claims, damages and demands of every kind, known or unknown, suspected or unsuspected, disclosed or undisclosed, arising out of or in any way related to such disputes and our service.<br />\r\n	<br />\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>7 Privacy & Information Disclosure</strong></span><br />\r\n	hiwantok.com has a Privacy Policy that explains to users how their information is collected and used. A copy of the current version of our Privacy Policy can be found at<a _fcksavedurl=\"http://www.hiwantok.com/privacy\" href=\"http://www.hiwantok.com/privacy\">http://www.hiwantok.com/privacy</a>Policy/. Your use of the Site or the Service signifies acknowledgement of and agreement to our Privacy Policy.<br />\r\n	You further acknowledge that hiwantok.com may, in its sole discretion, preserve or disclose your Content, as well as your information, such as email addresses, IP addresses, timestamps, and other user information, if required to do so by law or in the good faith belief that such preservation or disclosure is reasonably necessary to comply with the legal process, enforce</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<br />\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>8. Product Information</strong></span><br />\r\n	hiwantok.com draws your attention to the fact that all information advertised in the web sites originates entirely from the seller of items. The seller alone has evaluated and given his opinions on the condition of this piece of item. The evaluation is therefore not made by any impartial third party and hiwantok.com does not take any responsibility for the truthfulness or accuracy of such evaluation.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>9 Intellectual Property Rights</strong></span><br />\r\n	All intellectual property rights in the content such as text, graphics, software and other material of the web site as well as the arrangement and compilation of such content are the property of hiwantok.com (apart from third party content) and protected by Australian laws. All use including distribution, publication, reproduction, display or other exploitation of the content on the web site is strictly prohibited unless expressly authorised in writing by us.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>10 Breach</strong></span><br />\r\n	Without limiting other remedies available to hiwantok.com available at law, in equity or under this Agreement, we may, in our sole discretion immediately issue a warning, temporarily suspend, indefinitely suspend or terminate your registration and refuse to provide the services to you if:<br />\r\n	(a) you breach this Agreement or any of the terms and policies incorporated by reference;<br />\r\n	(b) we are unable to verify or authenticate any Information you provide to us;<br />\r\n	(c) we believe that your actions may cause legal liability for you, other users or us.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>11. Warranty</strong></span><br />\r\n	The contents of the site is provided \"as is\" and \"as available\". No warranty or condition, either express or implied, is made in relation to the accuracy, reliability or contents of the site. To the maximum extent permitted by law, we and our providers specifically disclaim any implied warranties of title, merchantability, fitness for a particular purpose and non-infringement.<br />\r\n	We do not warrant that the site or the servers that provide it are free of errors, viruses or other harmful components. We reserve the right to alter the site or withdraw access to it at our sole discretion.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>12. Liability</strong></span><br />\r\n	You agree not to hold hiwantok.com or any of its officers, employees, agents responsible or accountable for any of your listing, postings or information and nor shall we, our officers, employees or agents be liable for any misuse, illegal activity or third party content as most postings, listings or information are generated by various users directly and we do not have any role in the creation, publication or distribution of the posting, listing or information, nor are we in a position to have editorial control over the substance or content contained in the listings, postings, or information, save and except . You understand and agree that we do not guarantee the accuracy or legitimacy of any listing, posting, information by other users. You further agree that we are not liable for any loss of money, goodwill, or reputation, or any special, indirect, or consequential damages arising out of your use of the site or as a result of any sale, purchase of goods and services with other users of the site. We also cannot guarantee continuous or secure access to our Services. Accordingly, to the extent legally permitted we exclude all implied warranties, of merchantability, fitness or quality of the Site and our services.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>13. Indemnity</strong></span><br />\r\n	To the maximum extent permitted by law, the user indemnifies and agrees to hold hiwantok.com, its officers and employees (Those Indemnified) harmless against and from all Claims which may arise as a result of or in connection with the users use of the website, our services or this Agreement, including but not limited to your breach of this Agreement, your negligence, any untrue, false or misleading information or statement disclosed in an advertisement listed with your account.hiwantok.com holds the benefit of this indemnity on trust for Those Indemnified and Those Indemnified will be entitled to rely on the indemnity and have the user pay for all costs (including but not limited to legal costs on a solicitor and own client or indemnity basis) prior to Those Indemnified having incurred and paid such costs.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>14. Amendments to Agreement</strong></span><br />\r\n	Internet is an evolving medium. hiwantok.com may change the terms of this Agreement from time to time in which case we will post the revised terms on the web site. Except as stated below, all amended terms shall automatically be effective after they are initially posted on our website. If you do not agree with such changes, you must terminate your subscription to hiwantok.com By continuing to use this service following such changes you agree to be bound by the amended Agreement. This Agreement may not otherwise be amended except in writing, signed by you and hiwantok.com.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>15. Feedback</strong></span><br />\r\n	If you have any comments or improvement suggestions regarding the web site, please forward your comments and/or a copy of the material you believe to be inaccurate to the address (<a _fcksavedurl=\"mailto:info@hiwantok.com\" href=\"mailto:info@hiwantok.com\">info@hiwantok.com</a>) along with an explanation of your objection or suggestion<br />\r\n	.<br />\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>16. Invalidity of Provisions</strong></span><br />\r\n	If any provision or provisions of this Agreement shall be held to unenforceable, such provision shall be enforced to the fullest extent permitted by applicable law.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>17. Term and Termination</strong></span><br />\r\n	This Agreement comes into effect when you register and accept the terms and conditions and they are in force until further notice. .sg may at any time and at its sole discretion deny access to the web site from a User for any reason.</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	<span style=\"color: rgb(0, 0, 255);\"><strong>18. Governing Law and Jurisdiction</strong></span><br />\r\n	This Agreement and the relationship between the user and hiwantok.com shall be governed by and interpreted in accordance with the laws of Australia excluding its rules for choice of law. All disputes that cannot be solved amicably shall be finally settled by court of law</p>\r\n<p style=\"color: rgb(0, 0, 0); font-size: 12px;\">\r\n	</p>', 'terms-of-use'),
